%[text] %[text:anchor:T_B948BEBD] # **Induction Motor Chart Examples**
%[text] **Overview**
%[text] The `InductionMotorChart` visualizes the performance of an induction motor in speed-torque coordinates. Thanks to Chris Armstrong for the idea behind this example. 
%[text] The chart data comprises a scalar [`InductionMotorParameters`](<matlab: edit("InductionMotorParameters")>) object, which has the following properties:
%[text] - `NormalRegion`: a rectangular region representing the normal operating regime of the motor.
%[text] - `BufferRegion`: two distinct rectangular regions, above and below the normal operating region, representing the buffer zone between the normal region and the overload region.
%[text] - `OverloadRegion`: two distinct trapezoidal regions, above and below the buffer regions, representing values where the motor is overloaded.
%[text] - `Bounds`: speed-torque coordinates of the bounds used for visualizing the motor performance; these bounds will be slightly more than the min/max motor performance values.
%[text] - `ReducedCurves`: a set of speed-torque curves bounding the acceptable operating points of the motor.
%[text] - `RatedCurves`: a set of speed-torque curves bounding the maximum rated operating points of the motor. \
%[text] In addition to the motor parameters, the chart data comprises the operating point $(\\omega, \\tau)$ in speed-torque coordinates, where $\\omega$ is the motor speed (RPM) and $\\tau$ is the motor torque (Nm). The operating point can be moved freely by setting its value.
%[text] The chart also has an event (`AbnormalPerformanceDetected`) and an associated callback function (`AbnormalPerformanceDetectedFcn`). The event is notified when the operating point of the motor is not within the normal operating region.
%[text] ![InductionMotorChart.png](text:image:5b2b)
%[text] **Documentation**
%[text] - [`patch`](<matlab: doc("patch")>): Create patches of colored polygons
%[text] - [`line`](<matlab: doc("line")>): Create primitive line
%[text] - [`plot`](<matlab: doc("plot")>): 2-D line plot
%[text] - [`datatip`](<matlab: doc("datatip")>): Create data tip
%[text] - [`InductionMotorParameters`](<matlab: edit("InductionMotorParameters")>): Stores parameters for an induction motor \
%[text:tableOfContents]{"heading":"Table of Contents"}
%%
%[text] %[text:anchor:H_0EF8A30C] ## Import a set of induction motor parameters.
motorParametersFolder = fullfile( chartsRoot(), "data", "MotorParameters" );
IMP = InductionMotorParameters( motorParametersFolder );
disp( IMP ) %[output:54a8fc0d]
%%
%[text] %[text:anchor:H_967E0FE5] ## Create a figure for the chart.
f = exampleFigure( "Name", "InductionMotorChart Example" ); %[output:4390cc0f]
%%
%[text] %[text:anchor:H_D719D672] ## Create the chart.
IMC = InductionMotorChart( "Parent", f, "MotorParameters", IMP ); %[output:4390cc0f]
%%
%[text] %[text:anchor:H_F5F036EE] ## Move the operating point.
IMC.OperatingPoint = [2000, 200]; %[output:00978629]
%%
%[text] ## Respond to abnormal performance using a callback function.
%[text] Define the callback function.
IMC.AbnormalPerformanceDetectedFcn = @( s, e ) disp( "Abnormal performance detected!" ); %[output:81a3cd17]
%[text] Move the operating point to the buffer region.
IMC.OperatingPoint = [2000, -450]; %[output:2ac5e9cf]
%%
